import React from 'react';
import oven1 from '../assets/oven1.JPG';
import oven2 from '../assets/oven2.JPG';
const OvensView=()=>{
    return(
        <div >
            <img className="img" src={oven1}/>
            <img className="img" src={oven2}/>
            <img className="img" src={oven1}/>
            <img className="img" src={oven2}/>
            <img className="img" src={oven2}/>
        </div>
    )
};

export default OvensView;
